import { useEffect, useState } from "react";

export const Userdata = () => {


    const [user, setuser] = useState([])

    useEffect(() => {

        getuser()
    }, [])




    const getuser = async () => {

        const res = await fetch("http://localhost:9000/api/alluser", {

            method: "GET"

        });
        if (res.ok) {
            const result = await res.json()
            if (result.statuscode === 1) {
                setuser(result.userlist)

            }
            else {
                alert("No data Fetched")
            }

        }



    }

    return (


        <>

            <h1>ALL user</h1>

            <table>
                <tr>
                    <td>Userid</td>
                    <td>FirstName</td>
                    <td>lastname</td>
                    <td>Email</td>
                    <td>Usertype</td>
                </tr>
                {
                    user.map((data, i) => (

                        <tr key={i}>
                             <td>{data._id}</td>
                            <td>{data.fisrtname}</td>
                            <td>{data.lastname}</td>
                            <td>{data.email}</td>
                            <td>{data.usertype}</td>


                        </tr>


                    ))
                }


            </table>
        </>
    )
}
